\begin{align*}
 \vec{a}_{y_i}^{\top} \vec{p} &=
 \begin{bmatrix}
 0, 0, 0, 0, -X_i, -Y_i, -Z_i, -1, y_i X_i, y_i Y_i, y_i Z_i, y_i
 \end{bmatrix}
 \begin{bmatrix}
 p_{11} \\
 p_{12} \\
 p_{13} \\
 p_{14} \\
 p_{21} \\
 p_{22} \\
 p_{23} \\
 p_{24} \\
 p_{31} \\
 p_{32} \\
 p_{33} \\
 p_{34}
 \end{bmatrix}\\
 &= 
 \begin{bmatrix}
 \quad \quad \quad \mathbf{0},& \quad \quad \quad -\mathbf{X}_i^{\top},& \quad \quad \quad \quad y_i \mathbf{X}_i^{\top} \, \, \, \, \quad \quad \quad
 \end{bmatrix}
 \begin{bmatrix}
 \mathbf{A} \\
 \mathbf{B} \\
 \mathbf{C}
 \end{bmatrix} \\
 &= \quad \quad \quad \quad \quad \quad \quad \quad -\mathbf{X}_i^{\top} \mathbf{B} \quad \quad \quad \quad+ y_i \mathbf{X}_i^{\top} \mathbf{C}
 \end{align*}

\begin{align*}
 \vec{a}_{x_i}^{\top} \vec{p} &=
 \begin{bmatrix}
 -X_i, -Y_i, -Z_i, -1, 0, 0, 0, 0, x_i X_i, x_i Y_i, x_i Z_i, x_i
 \end{bmatrix}
 \begin{bmatrix}
 p_{11} \\
 p_{12} \\
 p_{13} \\
 p_{14} \\
 p_{21} \\
 p_{22} \\
 p_{23} \\
 p_{24} \\
 p_{31} \\
 p_{32} \\
 p_{33} \\
 p_{34}
 \end{bmatrix}\\
 &= 
 \begin{bmatrix}
 \quad \quad \quad -\mathbf{X}_i^{\top},& \quad \quad \quad \mathbf{0},& \quad \quad \quad \quad x_i \mathbf{X}_i^{\top} \, \, \, \, \quad \quad \quad
 \end{bmatrix}
 \begin{bmatrix}
 \mathbf{A} \\
 \mathbf{B} \\
 \mathbf{C}
 \end{bmatrix} \\
 &= \quad \quad \quad \quad -\mathbf{X}_i^{\top} \mathbf{A} \quad \quad \quad \quad \quad \quad \quad \quad+ x_i \mathbf{X}_i^{\top} \mathbf{C}
 \end{align*}
